<div class="contacts">
  <div class="contacts__container container">

    <ul class="contacts__list">
      @php
        $i = 0;
      @endphp
      @foreach ($contacts_list as $contact)
        @php
          $i++;
        @endphp
        {{-- @dump($contact) --}}
        <li class="contacts__item contacts__item_{{ $i }}">
          <div class="contacts__city">{{ $contact['city'] }}</div>
          <a href="{{ 'tel:' . str_replace( [
                    ")",
                    "(",
                    " ",
                    "-",
                    ], "", $contact['phone'] ) }}" class="contacts__phone">{{ $contact['phone'] }}</a>
          <div class="contacts__text">{{ $contact['text'] }}</div>
          <div class="contacts__country">{{ $contact['country'] }}</div>
        </li>
      @endforeach
    </ul>

